import React, { useState } from 'react'
import {Link} from 'react-router-dom'
import "./Register.css"
import axios from 'axios'

const Register = () => {
    const [values ,setValues]=useState({
        username: '',
        email: '',
        password: ''
    })
    const [message, setMessage] = useState('');
    const handleChanges= (e) => {
        setValues({...values, [e.target.name]:e.target.value})
    }
    const handleSubmit = async (e) => {
        e.preventDefault();
        try{
            const response=await axios.post('http://localhost:3000/auth/register',values)
            console.log(response)
            setMessage(response.data.message);
        }
        catch(error){
            console.log(error);
            setMessage(error.response?.data?.message || 'Registered Successfully');
        }
    }

  return (
    <div className='body'>
        <div className='Register'>
        <div >
            <Link to="/" type="back" className='backBtn'>Back</Link>
            <h1>Register</h1>
            {alert && <div className="alert">{alert}</div>}
            <form onSubmit={handleSubmit}>
                <div>
                    <label htmlFor='username'>Username</label>
                    <input type='text' placeholder='Enter Username' name="username" onChange={handleChanges} />
                </div>
                <div>
                    <label htmlFor='email'>Email</label>
                    <input type='email' placeholder='Enter Email' name="email" onChange={handleChanges} />
                </div>
                <div>
                    <label htmlFor='password'>Password</label>
                    <input type='password' placeholder='Enter Password' name="password" onChange={handleChanges} />
                </div>
                <button>Submit</button>
            </form>
            <div>
                <p>Already have account</p>
                <Link to="/Login">Login</Link>
            </div>
        </div>
        </div>
    </div>
  )
}

export default Register
